  return(
    <div className="navbar">
      <ul className="navbar-ul">
        <a href="#about">A Propos de Moi</a>
        <img src="/mnkphoto\public\assets\images\tempphotolandscape.JPG"/>
        <a href="#services">Mes Services</a>
        <a href="#contact">Prendre Contact</a>
      </ul>
    </div>
  )
}
